import React from "react";
import {Button,Form,Table} from "react-bootstrap";


function Payment({onSubmit,onChange}){
    return(
        <Form onSubmit={onSubmit}>
            <h3 className="mb">Payment</h3>
            <label className="mr" >Accepted Cards:</label>
            <img src="card.jpg" ></img>
            <Table className="mt">
                <tbody>
                    <tr>
                        <td>
                        <Form.Label for="cname">Name on Card:</Form.Label>
                        </td>
                        <td>
                        <Form.Control type="text" id="cname" name="cardname"  placeholder="John More Doe" />
                        </td>
                    </tr>
                </tbody>
            </Table>

        </Form>
    );
}


export default Payment;
